import React from 'react';
import './About.css';
import about from "../images/About.png";

const About = () => {
    return (
        <div className="about">
            <div className="about_top">
                <h1>About Us</h1>
            </div>
            <div className="about_bottom">
                <h2>Finding a new home is just the beggining</h2>
            <div className="about_bottomimg">
            <p><img src={about} alt=""/></p>
            </div>
            </div>
        </div>
    )
}

export default About;
